      SELECT DISTINCT - - col2 / + col2 + col0 * 94 FROM tab2 (FORMAT parquet) WHERE + col0 * - col2 NOT BETWEEN ( - 43 * + col0 - + 83 ) AND ( NULL );
  - name: tab2

outputs:
